import logo from './logo.svg';
import './App.css';
import React from 'react';
import { fileUpload } from './fileUpload';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      <h1>best app ever</h1>
      <p>{!data ? "Loading..." : data}</p>
      <fileUpload />
    </div>
  );
}

export default App;
